import React, { Component } from 'react'
import Layout from './Layout'
import News from './News'

export class index extends Component {
    
    render() {
        return (
            <div>
                <Layout>
                    <h1>Home</h1>
                    <News/>
                </Layout>
            </div>
        )
    }
}

export default index
